import React from 'react';
import { Switch, Route, Link } from 'react-router-dom';


import './App.css';

function App() {
  const [data, setData] = React.useState(null);

  React. useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <div className="App">
      <h1> Shyft </h1>
      <nav className="topnav">
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default App;
